func Syscall(n int) (syscallinfo.Syscall, error) {
	sc, ok := syscalls[n]
	if !ok {
		return syscallinfo.Syscall{}, errors.New("unknown syscall")
	}
	return sc, nil
}

func SyscallByEntry(entry string) (syscallinfo.Syscall, error) {
	for _, sc := range syscalls {
		if sc.Entry == entry {
			return sc, nil
		}
	}
	return syscallinfo.Syscall{}, errors.New("unknown syscall")
}
